  username: string;
}

const UserProfilePage: React.FC<Props> = ({ username }) => {
  const fetchUser = async () => {
    const res = await fetch(`${host}/users/`);
  };

  return (
    <React.Fragment>
      <p>{}</p>
    </React.Fragment>
